INSERT INTO `areacomum` VALUES (33,NULL,NULL,'Área do condomínio para realizar festas.','Salão de festas','',NULL,1,NULL),(34,NULL,NULL,'','Piscina','',NULL,1,''),(35,NULL,NULL,'','Churrasqueira','',NULL,1,''),(36,NULL,NULL,'Churrasqueira','Churrasqueira','',NULL,30,NULL),(37,NULL,NULL,'','Salão de festas','',NULL,30,NULL),(40,NULL,NULL,'','Salão de festas / Churrasqueira','',NULL,31,'<div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px; font-weight: bold;\">CAPÍTULO VIII – DO USO DO SALÃO DE FESTAS E ÁREA DE CHURRASQUEIRA&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Art.33 – O Salão de festas e a área de churrasqueira poderão ser usados pelos moradores do Condomínio mediante reserva antecipada de 15 dias, em livro próprio, de posse de Portaria.&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Parágrafo primeiro – O salão de festas e área de churrasqueira serão sempre reservados em conjunto;&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><span style=\"text-decoration: underline;\">Parágrafo segundo – Somente será permitida a reserva do salão de festas e área de churrasqueira àqueles condôminos que estiverem quites com as Taxas de Condomínio;</span>&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Parágrafo terceiro – É de exclusiva responsabilidade do condomínio que reservou e utilizou o salão de festas e a área de churrasqueira, a limpeza completa do interior, banheiros e área de passagem deles até as 12:00 horas do dia seguinte. Em nenhuma hipótese será de responsabilidade dos funcionários do Condomínio a limpeza dos locais reservados pelo condômino;&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Art.34 – Da solicitação deverão constar os horários de início e término da atividade de ocupação do salão, sendo que após as 22:00 horas deverão ser reduzidos o som e/ ou ruídos para não ser infringido este Regulamento;&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Parágrafo primeiro – Não serão permitido eventos com som alto que possam incomodar os demais condôminos, mesmo que antes das 22:00 horas; Parágrafo segundo - Fica estabelecido que de Segunda a Quinta – feira, o término das atividades ocupação do salão de festas e área de churrasqueira será às 22:00 horas. As atividades realizadas nas Sextas, Sábados e Domingos terão horário de término fixado à 01:00 hora do dia seguinte.&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Art.35 – Na data reservada para o uso do salão de festas área de churrasqueira, estes serão de uso exclusivo do requisitante e de seus convidados, que deverão ser anunciadas, pela Portaria.&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Parágrafo único - O condômino requisitante deverá apresentar à Portaria a relação de convidados, a fim de evitar a entrada de estranhos nas dependências do Condomínio.&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Art.36 – Os danos causados ao salão, às mobílias, eletrodomésticos e utensílios correrão por conta e responsabilidade do requisitante, que pagará pelas reparações e consertos.&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Art.37 – Fica expressamente proibida a cessão do salão a pessoas não residentes no Condomínio, bem como para reuniões políticas e jogos infantis.&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Art.38 – Não será permitido efetuar perfuração em paredes, ou qualquer coisa que afete a higiene e conservação do ambiente.&nbsp;</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Art.39 – Nas festas tradicionais: Natal, Ano Novo, Páscoa e São João o salão será de uso comum, preferencialmente do Condomínio.</span></font></div>'),(41,NULL,NULL,'Quadra bla bla','Quadra de Futebol','',NULL,1,''),(42,NULL,NULL,'Piscina Infantil','Piscina','',NULL,1,'Funcionamento: Após 8 da manhã.<br><br>Taxa: R$40,00<br>'),(43,NULL,NULL,'','Salão de Festa','',NULL,32,''),(44,NULL,NULL,'Espaço destinado a confraternização e festas.','Churrasqueira','',NULL,34,''),(45,NULL,NULL,'Espaço destinado a confraternizações e festas.','Salão de festas','',NULL,34,''),(46,NULL,NULL,'','Quadra de Futebol','',NULL,32,''),(47,NULL,NULL,'','Academia','\0',NULL,1,'Academia de ginástica ao ar livre deverá ser utilizada até 18hrs.'),(48,NULL,NULL,'Estacionamento é uma área comum do prédio onde foi realizado o sorteio de vagas. Mesmo demarcadas com o número de cada apto a mesma é destinada como área comum. Vide convenção.','Estacionamento','',NULL,35,''),(51,NULL,NULL,'Área reservada para realização de churrascos para os moradores do Bosque das Seringueiras e seus convidados.','Churrasqueira','',NULL,37,'Mantenha o ambiente sempre organizado e entregue limpo. Respeite o horário de silêncio.'),(50,NULL,NULL,'Piscina adulto','Piscina','\0',NULL,32,''),(52,NULL,NULL,'Área reservada para realização de práticas de esportes para os moradores do Bosque das Seringueiras.','Quadra de futebol','',NULL,37,'<div>Área reservada para realização de&nbsp;práticas de esportes para os moradores do Bosque das Seringueiras.</div>');
