INSERT INTO `batepapo` VALUES (19,'Olá vizinhos. Agora temos esse espaço para trocar algumas ideias. Abraços.',1,1,'2015-12-17 10:54:49'),(20,'Oi Pessoal! Estou aprovando a ideia desse sistema para o condomínio! Acho válida a tentativa.',30,89,'2016-01-13 17:11:21'),(23,'Boa tarde, \r\nA construtora deu algum retorno de quando voltarão a funcionar os interfones?',31,160,'2016-04-27 14:19:37'),(25,'Olá! gostaria de uma posição a respeito do conserto do interfone do meu apartamento 602 bloco 01, até o momento não foi regularizado o funcionamento a quem devo recorrer. Aguardo retorno.',31,159,'2016-07-31 21:10:38'),(26,'Boa noite,  a empresa  que instalou o interfone foi contratada pela construtora  apponto, sendo assim qualquer solicitação,  duvidas, devem ser direcionado  a construtora  através  do telefone 30257005, falar com Ramon. E assim agendar o serviço. ',31,104,'2016-08-01 20:07:56'),(27,'As lâmpadas das escadas do bloco 1 não acenderam neste final de semana. Acredito que tem algum problema com os sensores de presença. Reparei apenas entre o primeiro e segundo andares.',31,171,'2016-10-10 10:05:56'),(28,'Não estou conseguindo acessar as imagens das Câmeras de Segurança.',31,138,'2016-10-11 00:27:50'),(29,'E ai galera!',1,1,'2016-10-24 17:30:14'),(30,'Boa tarde à todos! Nosso condomínio está ficando muito organizado, tenho muito orgulho de morar aqui. Abraços à todos!',1,210,'2016-11-03 15:42:25'),(32,'Pessoal, uma das minhas vagas de garagem está disponível. Quem tiver interesse, me procure. Disponho.',31,171,'2016-11-07 16:39:20'),(33,'Tentei ativar as cameras mas não consigo. Poderia verificar se há algum erro ?',31,106,'2016-11-15 21:40:23'),(35,'Bom dia! Estou com dificuldades para manter reservada a área em comum nas datas 31/12 e 14/01. Recebo a confirmação da reserva por e-mail mas no dia seguinte as datas não estão reservadas no calendário de reservas. Favor considerar que tais datas já estão reservadas.',31,171,'2016-12-15 09:44:40');
