INSERT INTO `mensagemsindico` VALUES (6,'2015-12-18','Olá senhor síndico. Gostaria de informá-lo que os extintores da áreas externa estão com a data de validade vencida. Desde já agradeço.',1,1),(7,'2016-01-11','Oi síndico! Tenho uma reclamação para fazer. Estão deixando o salão de festas sujo após a utilização. Gentileza avisar as pessoas sobre isso.',1,80),(8,'2016-01-11','Oi sindico. Vou tentar enviar uma mensagem com menos caracteres. Obrigado',1,80),(9,'2016-01-13','Oi Síndico! Estou enviando esta mensagem para ver se funciona mesmo. Obrigado.',30,89),(16,'2016-05-19','Bom dia Wanderley!! Gostaria de saber se a empresa que vai instalar os interfones do bloco 2 também vão finalizar os do bloco 1 que ficaram sem funcionar, por que o meu 703 Bloco. 1 não funciona.\r\nDesde já agradeço!!! ',31,145),(17,'2016-06-20','Bom dia.\r\n\r\nPrezado Wanderley,\r\n\r\nGostaria de sugerir a instalação de uma placa no parquinho informando que os brinquedos devem ser utilizados por crianças até 10 anos. \r\nVarias vezes já vi adolescentes e adultos utilizando o balanço do parquinho. Inclusive ocorreu isso ontem. \r\nConto c/ sua colaboração.\r\n\r\nGrato.\r\n\r\nRodrigo.',31,169),(18,'2016-07-14','Boa tarde,\r\nvocê teria o telefone do rapaz que fez a intalação do gás nos apartamentos quando o gás passou a ser compartilhado?\r\nAtt.\r\nVeridiane',31,119),(19,'2016-08-01','Bom dia.\r\n\r\nPrezado Vanderley,\r\n\r\nOntem, (31/07/2016), por volta das 17:30 a moradora do apto 402 BL 01 ( portuguesa) ao lavar a varando deixou a agua escorrer , molhando minha varanda  e todas as minhas roupas que estavam secando. Imediatamente fiz o registro no livro.\r\n\r\nconto com sua colaboração p/ tomar as providencias cabíveis.\r\nObrigado.\r\n\r\nRodrigo A. César\r\nApto 202 BL 01',31,169),(21,'2016-09-20','Prezado Wanderley,\r\n\r\nOuvi falar que querem cimentar a área em frente ao bloco 01. Gostaria de informar, que, eu e minha esposa não concordamos com tal medida, pois somos contra a redução da área verde do condomínio,  além do condomínio ficar cada vez mais descaracterizado com seu projeto arquitetônico. Qualquer obra, que não seja emergencial, deve ir a votação.\r\n\r\nConto c/ sua compreensão e fico no aguardo de uma resposta.\r\n\r\nGrato.\r\n\r\nRodrigo e Carolina.\r\nAp 202 BL 01',31,169),(22,'2016-10-17','Bom dia , \r\nWanderley segue  as minhas dúvidas sobre reclamações do aptº:\r\n* entrada da t.v só cabe um cabo- mangueira  emendada.\r\n*parece que o fluxo de água para a saída da área privativa está voltando.\r\natenciosamente\r\nConceição e guilherme',31,161),(23,'2016-10-17','Gostaria de acessar as imagens das cameras. Poderia nos passar o passo a passo para instalar o programa ?',31,106),(24,'2016-10-17','Boa tarde!!\r\n\r\nWanderley,\r\nPeço que informe a construtora que no meu apto está ocorrendo  mofo nas paredes dos quartos.\r\nObrigado.\r\nRodrigo Augusto - AP 202 BL 01',31,169),(25,'2016-10-17','Boa tarde!!\r\nWanderley,\r\n\r\nGostaria apenas de sugerir a instalação de uma tomada próximo ao fogão do salão de festas, para poder acender o mesmo pelo acendimento automático.\r\nObrigado.\r\nRodrigo - AP 202 BL 01\r\n\r\n',31,169),(26,'2016-10-20','As lâmpadas das escadas do bloco 1 não acendem desde o dia 10/10. Acredito que tem algum problema com os sensores de presença. Reparei apenas entre o primeiro e segundo andares.',31,171),(27,'2016-10-20','Ola Síndico.',1,1),(28,'2016-10-21','Boa noite. Gostaria de saber se será possível a limpeza do salão e churrasqueira por conta do condomino para aqueles que não desejam pagar a taxa. Assim não será necessário o pagamento da taxa para os que optarem pela limpeza por conta própria. Obrigado ',31,166),(38,'2016-12-15','Bom dia! Estou com dificuldades para manter reservada a área em comum nas datas 31/12 e 14/01. Recebo a confirmação da reserva por e-mail mas no dia seguinte as datas não estão reservadas no calendário de reservas. Favor considerar que tais datas já estão reservadas.',31,171),(31,'2016-11-03','Prezado síndico, gostaria de avisar que as lâmpadas da entrada estão queimadas. Obrigado.',1,80),(32,'2016-11-07','As lâmpadas das escadas do bloco 1 não acendem há 1 mês (desde 10/10/2016). Acredito que tem algum problema com os sensores de presença. Reparei apenas entre o primeiro e segundo andares, pois uso as escadas todos os dias.',31,171),(33,'2016-11-11','Boa tarde Wanderley,\r\n\r\nInformo que lâmpada das escadaria do bloco 1 , entre o primeiro e segundo andar, está piscando e não está apagando, ou seja, ela está ficando acesa  mesmo sem a presença de ninguém. Peço que verifique.',31,169),(34,'2016-11-11','preciso urgente de contato ',1,206),(35,'2016-11-14','Boa Noite, \r\nSobre os porteiros, gostaria de obter mais informações a respeito da jornada de trabalho. Por votação, a portaria do ponto Imperial tem porteiros trabalhando no periodo noturno, eles estavam no periodo diurno somente por um tempo em que estavam arrumando os interfones, certo? ',31,160),(37,'2016-11-29','Bom dia, Wanderley! Peço, por favor, que a porta de vidro do bloco 1 seja verificada. Ao abri-la totalmente está fazendo um instalo e a fechadura, nem sempre, funciona corretamente.\r\nObrigada.',31,133),(46,'2017-01-27','Tenho reparado que há muito tempo não se faz limpeza nas escadas do bloco 1. Sujeira natural e teias de aranhas nas janelas, paredes e pisos manchados. Sensores de presença e lâmpadas queimadas há mais de 1 mês.',31,171),(40,'2016-12-24','Boa tarde Marcos!\r\nGostaria da ajuda do sr. para resolver um probleminha que temos desde o dia que nos mudamos para o condomínio.\r\nDurante o dia eu não posso reclamar porque estão dentro da lei, porem todos os 7 dias da semana durante toda a madrugada minha nobre vizinha do 302 arrasta os moveis, deixa cair objetos provocando um grande barulho no meu apartamento. Sei que algumas vezes isso pode acontecer, porem todos dias fica complicado pois levanto para trabalhar às 04:00 e acordo assustado toda madrugada com os barulhos provocados no apartamento de cima.\r\nConto a sua ajuda nessa resolução.\r\n',31,107),(45,'2017-01-16','Bom dia!!\r\n\r\nInformo que a porta de vidro do bloco 01 está fazendo um estalo forte ao abrir.\r\nConto c/ sua colaboração p/ resolver esse problema.\r\nObrigado\r\nRodrigo\r\nAp 202 BL 01',31,169),(47,'2017-01-28','Teste Condomínio Bosque das Seringueiras.\r\n\r\nJadir',35,219),(48,'2017-01-31','Boa tarde. Agendei com o Celso para fazer a limpeza do meu terreno na quinta dia 02/02, porém não consigo ir a Funilândia até esse dia para deixar a autorização. Poderia me passar um email de contato para que possa encaminhar o documento autorizando a realização do serviço?\r\nObrigada \r\nRafaela \r\nEtapa I Quadra 01 lote 32',32,555);
