INSERT INTO `noticia` VALUES (8,1,'<font face=\"Arial, Verdana\"><span style=\"font-size: 10pt;\">Olá vizinhos!</span></font><div style=\"font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: normal;\"><br></div><div style=\"font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: normal;\">Hoje temos uma importante missão. Combater juntos o mosquito aedes. </div><div style=\"font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: normal;\"><br></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">O mosquito é transmissor da dengue, chikungunya e zika vírus – este último, relacionado ao aumento de casos de microcefalia no estado. De acordo com o comandante da operação em Pernambuco, o general Antônio Eudes Lima da Silva, as determinações do Comando do Exército são para que os soldados empreguem todo o apoio necessário solicitado pelo governo.O mosquito é transmissor da dengue, chikungunya e zika vírus – este último, relacionado ao aumento de casos de microcefalia no estado. De acordo com o comandante da operação em Pernambuco, o general Antônio Eudes Lima da Silva, as determinações do Comando do Exército são para que os soldados empreguem todo o apoio necessário solicitado pelo governo.</span></font></div><div style=\"font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant: normal; font-weight: normal; line-height: normal;\"><br></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">O mosquito Aedes aegypti mede menos de um centímetro, tem aparência inofensiva, cor café ou preta e listras brancas no corpo e nas pernas. Costuma picar nas primeiras horas da manhã e nas últimas da tarde, evitando o sol forte. No entanto, mesmo nas horas quentes ele pode atacar à sombra, dentro ou fora de casa. Há suspeitas de que alguns ataquem durante a noite. O indivíduo não percebe a picada, pois não dói e nem coça no momento. Por ser um mosquito que voa baixo - até dois metros - é comum ele picar nos joelhos, panturrilhas e pés.</span></font></div>','2016-11-20',0,'Vamos junto combater o AEDES',1),(9,1,'<div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Antes de anotar todas as dicas de economia de água é bom lembrar que a empresa responsável por tratar e levar a água para os moradores da cidade é a Manaus Ambiental. A água desperdiçada não pode ser aproveitada nem por você, nem pelos outros e nem pela Manaus Ambiental. Então quando alguém desperdiça todos perdem, inclusive a natureza!</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Aqui você pode aprender a fazer a sua parte evitando desperdício e garantindo economia na conta de água!</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">É importante saber: Nas contas de água todo o volume registrado pelo hidrômetro é considerado consumo e esse aparelho apura estes três fatores:</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">CONSUMO EFETIVO - O que é percebido como consumo real. Varia de acordo com as necessidades em cada domicílio.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">DESPERDÍCIO - Perdas voluntárias durante as atividades domésticas e causadas pelo mau uso da água e por maus hábitos.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">VAZAMENTO - Perdas involuntárias, geralmente não aparentes, em torneiras, sanitários, caixas d’agua e outros.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><br></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Por isso é tão importante evitar desperdícios de água e reparar os vazamentos para conseguir reduzir os valores das suas contas.</span></font></div>','2015-12-17',0,'Água. Economize pois pode faltar.',1),(10,1,'<div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">A partir de agora o condomínio Ponto Imperial conta com a ajuda do site \"condominiosobcontrole.com.br\" para facilitar na gestão do condomínio.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">O projeto do site é realizar uma parceria junto ao condomínio Ponto Imperial para a criação de um sistema que facilite&nbsp;</span></font><span style=\"font-size: 13.3333px; font-family: Arial, Verdana;\">a vida do síndico e a convivência dos condôminos.</span></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Com a ajuda do sistema, os condôminos poderão participar de votações, reservar salão de festas, </span></font><span style=\"font-size: 13.3333px; font-family: Arial, Verdana;\">enviar pautas para a assembleia, acessar a ata, emitir boletos, visualizar demonstrativos financeiros,&nbsp;</span><span style=\"font-size: 13.3333px; font-family: Arial, Verdana;\">indicar produtos e serviços aos vizinhos e tudo isso de forma online.</span></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">A parceria consiste em verificar quais as principais necessidades do condomínio, descobrir a melhor maneira de resolvê-las,&nbsp;</span></font><span style=\"font-size: 13.3333px; font-family: Arial, Verdana;\">realizar uma análise da viabilidade da solução e implantar no sistema.</span></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">O site está aberto a críticas e sugestões através do e-mail \"contato@condominiosobcontrole.com.br\" para melhorar o sistema&nbsp;</span></font><span style=\"font-size: 13.3333px; font-family: Arial, Verdana;\">e consequentemente a convivência dos condôminos</span></div>','2016-01-13',0,'Condomínio Ponto Imperial realiza parceria com o site condominiosobcontrole.com.br',30),(11,1,'<h2 style=\"outline: none medium; margin: 0px 0px 10px; font-family: Tahoma, Arial, Verdana, sans-serif; color: rgb(99, 99, 99); text-rendering: optimizeLegibility; font-size: 1.2em;\">Qual a origem do mosquito Aedes Aegypti?</h2><p style=\"outline: none medium; margin: 0px 0px 10px; color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\">O&nbsp;<em style=\"outline: none medium;\">A. aegypti&nbsp;</em>é originário do Egito. A dispersão pelo mundo ocorreu da África: primeiro da costa leste do continente para as Américas, depois da costa oeste para a Ásia.</p><hr style=\"outline: none medium; margin: 20px 0px; border-right-width: 0px; border-left-width: 0px; border-top-style: solid; border-top-color: rgb(238, 238, 238); border-bottom-style: solid; border-bottom-color: rgb(255, 255, 255); color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\"><h2 style=\"outline: none medium; margin: 0px 0px 10px; font-family: Tahoma, Arial, Verdana, sans-serif; color: rgb(99, 99, 99); text-rendering: optimizeLegibility; font-size: 1.2em;\">Por que o nome Aedes Aegypti?</h2><p style=\"outline: none medium; margin: 0px 0px 10px; color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\">O vetor foi descrito cientificamente pela primeira vez em 1762, quando foi denominado&nbsp;<em style=\"outline: none medium;\">Culex aegypti</em>.&nbsp;<em style=\"outline: none medium;\">Culex&nbsp;</em>significa “mosquito” e&nbsp;<em style=\"outline: none medium;\">aegypti</em>, egípcio, portanto: mosquito egípcio. O gênero&nbsp;<em style=\"outline: none medium;\">Aedes&nbsp;</em>só foi descrito em 1818. Logo verificou- se que a espécie&nbsp;<em style=\"outline: none medium;\">aegypti</em>,&nbsp; descrita anos antes, apresenta características morfológicas e biológicas semelhantes às de espécies do gênero&nbsp;<em style=\"outline: none medium;\">Aedes</em>&nbsp;– e não às do já conhecido gênero&nbsp;<em style=\"outline: none medium;\">Culex</em>. Então, foi estabelecido o nome&nbsp;<em style=\"outline: none medium;\">Aedes aegypti</em>.</p><hr style=\"outline: none medium; margin: 20px 0px; border-right-width: 0px; border-left-width: 0px; border-top-style: solid; border-top-color: rgb(238, 238, 238); border-bottom-style: solid; border-bottom-color: rgb(255, 255, 255); color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\"><h2 style=\"outline: none medium; margin: 0px 0px 10px; font-family: Tahoma, Arial, Verdana, sans-serif; color: rgb(99, 99, 99); text-rendering: optimizeLegibility; font-size: 1.2em;\">Quantas pessoas um mosquito é capaz de infectar?</h2><p style=\"outline: none medium; margin: 0px 0px 10px; color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\"><span style=\"outline: none medium;\">Os mosquitos fêmea sugam sangue para produzir ovos. Se o mosquito da dengue estiver infectivo, poderá transmitir o vírus da dengue neste processo. Em geral, mosquitos sugam uma só pessoa a cada lote de ovos que produzem. O mosquito da dengue tem uma peculiaridade que se chama “discordância gonotrófica”, que significa que é capaz de picar mais de uma pessoa para um mesmo lote de ovos que produz. Há relato de que um só mosquito da dengue infectivo transmitiu dengue para cinco pessoas de uma mesma família, no mesmo dia.</span></p><hr style=\"outline: none medium; margin: 20px 0px; border-right-width: 0px; border-left-width: 0px; border-top-style: solid; border-top-color: rgb(238, 238, 238); border-bottom-style: solid; border-bottom-color: rgb(255, 255, 255); color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\"><h2 style=\"outline: none medium; margin: 0px 0px 10px; font-family: Tahoma, Arial, Verdana, sans-serif; color: rgb(99, 99, 99); text-rendering: optimizeLegibility; font-size: 1.2em;\"><span style=\"outline: none medium;\">Por que só a fêmea pica?</span></h2><p style=\"outline: none medium; margin: 0px 0px 10px; color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\"><span style=\"outline: none medium;\">A fêmea precisa de sangue para a produção de ovos. Tanto o macho quanto a fêmea se alimentam de substâncias que contêm açúcar (néctar, seiva, entre outros), mas como o macho não produz ovos, não necessita de sangue. Embora possam ocasionalmente se alimentar com sangue antes da cópula, as fêmeas intensificam a voracidade pela hematofagia após a fecundação, quando precisam ingerir sangue para realizar o desenvolvimento completo dos ovos e maturação nos ovários. Normalmente, três dias após a ingestão de sangue as fêmeas já estão aptas para a postura, passando então a procurar local para desovar.</span>&nbsp;</p><hr style=\"outline: none medium; margin: 20px 0px; border-right-width: 0px; border-left-width: 0px; border-top-style: solid; border-top-color: rgb(238, 238, 238); border-bottom-style: solid; border-bottom-color: rgb(255, 255, 255); color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\"><h2 style=\"outline: none medium; margin: 0px 0px 10px; font-family: Tahoma, Arial, Verdana, sans-serif; color: rgb(99, 99, 99); text-rendering: optimizeLegibility; font-size: 1.2em;\">Como o Aedes Aegypti chegou ao Brasil?&nbsp;Há registro histórico de dengue no passado?</h2><p style=\"outline: none medium; margin: 0px 0px 10px; color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\"><span style=\"outline: none medium;\">As teorias mais aceitas indicam que o&nbsp;</span><em style=\"outline: none medium;\">A. aegypti&nbsp;</em><span style=\"outline: none medium;\">tenha se disseminado da África para o continente americano por embarcações que aportaram no Brasil para o tráfico de escravos. Há registro da ocorrência da doença em Curitiba (PR) no final do século 19 e em Niterói (RJ) no início do século 20.</span></p><hr style=\"outline: none medium; margin: 20px 0px; border-right-width: 0px; border-left-width: 0px; border-top-style: solid; border-top-color: rgb(238, 238, 238); border-bottom-style: solid; border-bottom-color: rgb(255, 255, 255); color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\"><h2 style=\"outline: none medium; margin: 0px 0px 10px; font-family: Tahoma, Arial, Verdana, sans-serif; color: rgb(99, 99, 99); text-rendering: optimizeLegibility; font-size: 1.2em;\"><span style=\"outline: none medium;\">A dengue ocorre só no Brasil?</span></h2><p style=\"outline: none medium; margin: 0px 0px 10px; color: rgb(99, 99, 99); font-family: Tahoma, Arial, Verdana, sans-serif; font-size: 12px;\"><span style=\"outline: none medium;\">Não. Há registro da doença em diversos países das Américas, bem como na África, Ásia, Austrália &nbsp;e Polinésia Pacífica.</span></p>','2016-01-14',0,'Cuidado com o Aedes Aegypti!',30),(12,1,'<div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">A partir de agora o condomínio Ponto Imperial conta com a ajuda do site \"condominiosobcontrole.com.br\" para facilitar na gestão do condomínio.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">O projeto do site é realizar uma parceria junto ao condomínio Ponto Imperial para a criação de um sistema que facilite </span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">a vida do síndico e a convivência dos condôminos.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Com a ajuda do sistema, os condôminios poderão participar de votações, reservar salão de festas,  </span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">enviar pautas para a assembleia, acessar a ata, emitir boletos, visualizar demonstrativos financeiros, </span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">indicar produtos e serviços aos vizinhos e tudo isso de forma online.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">A parceria consiste em verificar quais as principais necessidades do condomínio, descobrir a melhor maneira de resolvê-las, </span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">realizar uma análise da viabilidade da solução e implantar no sistema.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">O site está aberto a críticas e sugestões através do email \"contato@condominiosobcontrole.com\" para melhorar o sistema </span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">e consequentemente a convivência dos condôminos</span></font></div>','2016-10-24',0,'Condomínio Ponto Imperial realiza parceria com o site condominiosobcontrole.com.br',1),(18,1,'Boa noite, sábado executaremos várias tarefas são elas:<div> 1- limpeza das caixas de gordura</div><div> 2- Colocação de telas nas grades caixas de chuvas</div><div> 3- pintura do portão</div><div> 4- tratamento da grama</div><div> 5- corte dos galhos secos dos coqueiros</div><div> 6- Dedetizacao contra baratas e ratos</div><div> 7- entrega do veneno contra escorpião,  aos moradores</div><div>       Que requisitaram. </div><div> 8- conserto da porta do Hall do bloco 1</div><div> 9- Colocação do