INSERT INTO `respostamensagemsindico` VALUES (2,'<p style=\"font-weight: normal;\"><b>Mensagem enviado por uma morador: </b></p><p style=\"font-weight: normal;\">Prezado Wanderley,\r\n\r\nOuvi falar que querem cimentar a área em frente ao bloco 01. Gostaria de informar, que, eu e minha esposa não concordamos com tal medida, pois somos contra a redução da área verde do condomínio,  além do condomínio ficar cada vez mais descaracterizado com seu projeto arquitetônico. Qualquer obra, que não seja emergencial, deve ir a votação.\r\n\r\nConto c/ sua compreensão e fico no aguardo de uma resposta.\r\n\r\nGrato.\r\n\r\nRodrigo e Carolina.\r\nAp 202 BL 01</p><br><p style=\"font-weight: normal;\"><b>Resposta do síndico: </b></p><p style=\"font-weight: normal;\"><b>Boa tarde Rodrigo tudo bem? então, a respeito destas e outras obras que serão colocadas em votação, depende exclusivamente da maioria, concordo plenamente com sua opinião, mas não posso negar de colocar qualquer solicitação em votação, espero que esteja presente, e de sua opinião a respeito desta e outras votações que serão colocadas em pauta;</b></p><p><b>Att.</b></p><p><b>&nbsp; Wanderley Gomes</b></p><p style=\"font-weight: normal;\"><b><br></b></p><br>',21,104,'2016-09-20 00:00:00','\0'),(3,'<p><b>Mensagem enviado por uma morador: </b></p><p>Gostaria de acessar as imagens das cameras. Poderia nos passar o passo a passo para instalar o programa ?</p><br><p><b>Resposta do síndico: </b></p>Boa tarde vizinho, o passo a passo se encontra neste site, basta baixar o tutorial e segui-lo, mas temos um problema tecnico que esta impossibilitando de acessarmos ela via internet, ja requisitei os devidos ajustes junto com a empresa que nos vendeu o equipamento, que alias e o nosso vizinho D<span style=\"font-size: 10pt;\">aniel do oitavo andar do bloco 2, vou reforçar o pedido, e se por um acaso tiver urgencia em acessar as cameras, combine comigo um horario que vamos ate a portaria e de la conseguimos acessar o horario e o dia que vc tem interesse em ver;</span><div><div>&nbsp; att.</div><div>&nbsp;Wanderley Gomes</div></div>',23,104,'2016-10-17 00:00:00','\0'),(4,'<p><b>Mensagem enviado por uma morador: </b></p><p>Bom dia , \r\nWanderley segue  as minhas dúvidas sobre reclamações do aptº:\r\n* entrada da t.v só cabe um cabo- mangueira  emendada.\r\n*parece que o fluxo de água para a saída da área privativa está voltando.\r\natenciosamente\r\nConceição e guilherme</p><br><p><b>Resposta do síndico:</b></p><p><b>Boa tarde, ok obrigado , vamos repassar a apponto.</b></p><p><b>&nbsp; Att.</b></p><p><b>&nbsp;Wanderley Gomes</b></p>',22,104,'2016-10-17 00:00:00','\0'),(5,'<p><b>Mensagem enviado por uma morador: </b></p><p>Boa tarde!!\r\n\r\nWanderley,\r\nPeço que informe a construtora que no meu apto está ocorrendo  mofo nas paredes dos quartos.\r\nObrigado.\r\nRodrigo Augusto - AP 202 BL 01</p><br><p><b>Resposta do síndico: </b></p>Boa tarde Rodrigo, estou neste momento requisitando a solução,&nbsp;<div>&nbsp; abcs.</div><div>&nbsp;Wanderley Gomes</div>',24,104,'2016-10-17 00:00:00','\0'),(6,'<p><b>Mensagem enviado por uma morador: </b></p><p>Boa tarde!!\r\nWanderley,\r\n\r\nGostaria apenas de sugerir a instalação de uma tomada próximo ao fogão do salão de festas, para poder acender o mesmo pelo acendimento automático.\r\nObrigado.\r\nRodrigo - AP 202 BL 01\r\n\r\n</p><br><p><b>Resposta do síndico: </b></p>boa tarde Rodrigo, bem lembrado, estava nos nossos planos, mas por esquecimento nao foi feito.<div>&nbsp; abcs.</div><div>&nbsp;Wanderley Gomes</div>',25,104,'2016-10-17 00:00:00','\0'),(7,'<p><b>Mensagem enviado por uma morador: </b></p><p>Ola Síndico.</p><br><p><b>Resposta do síndico: </b></p>Opa, td bem.',27,1,'2016-10-20 00:00:00',''),(8,'<p><b>Mensagem enviado por uma morador: </b></p><p>As lâmpadas das escadas do bloco 1 não acendem desde o dia 10/10. Acredito que tem algum problema com os sensores de presença. Reparei apenas entre o primeiro e segundo andares.</p><br><p><b>Resposta do síndico: </b></p>boa tarde Leandro.. tudo bem? neste fim de semana vou dar uma conferida geral e trocar estas lampadas/ sensores ok?<div>&nbsp; abcs.</div><div>&nbsp; Wanderley Gomes</div>',26,104,'2016-10-20 00:00:00','\0'),(9,'<p><b>Mensagem enviado por uma morador: </b></p><p>Boa noite. Gostaria de saber se será possível a limpeza do salão e churrasqueira por conta do condomino para aqueles que não desejam pagar a taxa. Assim não será necessário o pagamento da taxa para os que optarem pela limpeza por conta própria. Obrigado </p><br><p><b>Resposta do síndico: </b></p>Boa tarde luciano, infelizmente o processo sobre a cobrança da taxa, ou a opção do proprio morador fazer a limpeza, foi exaustivamente discutido na assembleia, sendo acatado a decisao da maioria, onde o morador devera retirar os detritos e a limpeza geral sera feita por uma pessoa indicada pela administração do condominio paga pela condomino que fez a reserva, obrigado pela sugestao.<div>Att.</div><div>&nbsp; Wanderley &nbsp;Gomes</div>',28,104,'2016-10-22 00:00:00','\0'),(13,'<p><b>Mensagem enviado por uma morador: </b></p><p>As lâmpadas das escadas do bloco 1 não acendem há 1 mês (desde 10/10/2016). Acredito que tem algum problema com os sensores de presença. Reparei apenas entre o primeiro e segundo andares, pois uso as escadas todos os dias.</p><br><p><b>Resposta do síndico: </b></p>Boa noite leandro, ja estive no local e constatei a queima dos sensores, porem estou aguardando o proximo dia 12 onde teremos caixa para comprar estes e outros sensores que precisam ser reparados, peco-lhe &nbsp;paciencia que sera resolvido.<div>&nbsp; &nbsp;att.</div><div>Wanderley Gomes</div>',32,104,'2016-11-07 00:00:00','\0'),(14,'<p><b>Mensagem enviado por uma morador: </b></p><p>Boa tarde Wanderley,\r\n\r\nInformo que lâmpada das escadaria do bloco 1 , entre o primeiro e segundo andar, está piscando e não está apagando, ou seja, ela está ficando acesa  mesmo sem a presença de ninguém. Peço que verifique.</p><br><p><b>Resposta do síndico: </b></p>Boa tarde Rodrigo, estas lampadas foram verificadas por mim no inicio da semana, sendo que troquei os sensores e as lampadas, mas o defeito nao era em nenhum dos dois, assim acionei o eletricista, porem ele nao veio, vou procurar outro para verificar o que realmente acontenceu.&nbsp;<div>att.</div><div>Wanderley Gomes</div>',33,104,'2016-11-13 00:00:00','\0'),(15,'<p><b>Mensagem enviado por uma morador: </b></p><p>Boa Noite, \r\nSobre os porteiros, gostaria de obter mais informações a respeito da jornada de trabalho. Por votação, a portaria do ponto Imperial tem porteiros trabalhando no periodo noturno, eles estavam no periodo diurno somente por um tempo em que estavam arrumando os interfones, certo? </p><br><p><b>Resposta do síndico: </b></p>Boa noite Izabela, o quadro de funcionarios noturnos não ficou decidido pois a votacao ficou em 7 a 7, &nbsp;no proximo dia 10 teremos nossa assembleia , voce pode colocar em pauta esta questao, basta dar esta sugestao e colocamos em votacao, se ficar decidido que ficamos sem funcionarios de dia, com certeza irei acatar. apesar de ter a certeza que esta mudanca tera reflexos expressivos no valor de nosso condominio, mas prevarecera a vontade da maioria.<div>&nbsp; Att.</div><div>&nbsp; Wanderley Gomes</div>',35,104,'2016-11-14 00:00:00','\0'),(16,'<p><b>Mensagem enviado por uma morador: </b></p><p>Bom dia, Wanderley! Peço, por favor, que a porta de vidro do bloco 1 seja verificada. Ao abri-la totalmente está fazendo um instalo e a fechadura, nem sempre, funciona corretamente.\r\nObrigada.</p><br><p><b>Resposta do síndico: </b></p>Bom dia, irei verificar, e dou um retorno;<div>&nbsp; Att.</div><div>&nbsp; Wanderley Gomes</div>',37,104,'2016-11-29 00:00:00',''),(17,'<p style=\"font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><b>Mensagem enviado por uma morador: </b></p><p style=\"font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\">Bom dia, Wanderley! Peço, por favor, que a porta de vidro do bloco 1 seja verificada. Ao abri-la totalmente está fazendo um instalo e a fechadura, nem sempre, funciona corretamente.\r\nObrigada.</p><br><p style=\"font-family: Arial, Verdana; font-size: 10pt; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal;\"><b>Resposta do síndico: </b></p><p><b><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt; font-weight: normal;\">Boa tarde, a porta foi regulada para o fechamento, porem o estalo somente com um </span><span style=\"font-size: 13.3333px;\">técnico</span><span style=\"font-size: 10pt; font-weight: normal;\">&nbsp;especializado, iremos entrar em contato com um &nbsp;para solucionar o problema,</span></font></b></p><p><b><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt; font-weight: normal;\">Att.</span></font></b></p><p><b><font face=\"Arial, Verdana\"><span style=\"font-size: 10pt; font-weight: normal;\">&nbsp; Wanderley Gomes</span></font></b></p><br>',37,104,'2016-11-30 00:00:00','\0'),(20,'<p><b>Mensagem enviado por uma morador: </b></p><p>Teste Condomínio Bosque das Seringueiras.\r\n\r\nJadir</p><br><p><b>Resposta do síndico:</b></p><p><br></p><p>Jadir, obrigado pela oportunidade.</p><p><br></p>',47,219,'2017-01-28 00:00:00',''),(21,'<p><b>Mensagem enviado por uma morador: </b></p><p>Boa tarde. Agendei com o Celso para fazer a limpeza do meu terreno na quinta dia 02/02, porém não consigo ir a Funilândia até esse dia para deixar a autorização. Poderia me passar um email de contato para que possa encaminhar o documento autorizando a realização do serviço?\r\nObrigada \r\nRafaela \r\nEtapa I Quadra 01 lote 32</p><br><p><b>Resposta do síndico:Boa tarde pode enviar no email presidenteestancia@outlook.com</b></p>',48,206,'2017-01-31 00:00:00','\0');
